import React from "react";
import "./styles.css";

const OutputDocument = ({ output, downloadOutput }) => {
  return (
    <div className="output-container">
      <h3 className="output-text">Output</h3>
      <div className="file-display-box" >
        {fileNames.map((name, index) => (
          <div className="file-name" key={index} >
            {name}
          </div>
        ))}
      </div>
      <button
        className="download-button"
        onClick={() => downloadOutput("output.txt", output)}
      >
        Download
      </button>
    </div>
  );
};

export default OutputDocument;
